Description:  Great men throughout the age have been drawn to women of shady character and 

criminal leanings, from Clyde Barrow's gun moll Bonnie to Andy Williams' trigger-happy wife Claudine. Actor 

Phil Hartman had a vicious bitch on his hands too, he just never figured it out until it was too late! At 

Jail Babes, we shield you from the danger but still give you a front row seat to the sexual antics of these 

hard-edged harlots.
